import React from "react";

function JobsCategory() {
  return (
    <div>
      <section className="">
        <div className="container max-w-7xl mx-auto px-4">
          <div className="Section-head">
            <h6 className="text-center text-blue-500 font-semibold text-semibold">
              Jobs Categories
            </h6>
            <h2 className="text-5xl">Choose Your Desire Category</h2>
          </div>
        </div>
      </section>
    </div>
  );
}

export default JobsCategory;
